import { Link } from "react-router-dom";

function Actions({ currentPage, showPrevPage, showNextPage }) {
  return (
    <div className="slider-actions-container pt-4">
      {currentPage === 0 ? (
        <span></span>
      ) : (
        <button onClick={showPrevPage} className="slider-action p-2">
          Prev
        </button>
      )}
      {currentPage === 1 ? (
        <Link
          to={"/StartingPage"}
          className="slider-action slider-action-finish p-2"
        >
          Finish
        </Link>
      ) : (
        <button onClick={showNextPage} className="slider-action p-2">
          Next
        </button>
      )}
    </div>
  );
}

export default Actions;
